import React, { Component } from 'react'
import Book from "../Book/book";

class BookList extends Component {


    render() {

        console.log("Props", this.props.bookState)

        return (
            this.props.bookState.map((items) => (
            <Book
            key={items.id}
            id={items.id}
            title={items.volumeInfo.title}
            link={items.volumeInfo.previewLink}
            authors={items.volumeInfo.authors && items.volumeInfo.authors.length > 1 ? items.volumeInfo.authors.join(", ") : book.volumeInfo.authors}
            image={items.volumeInfo.imageLinks ? items.volumeInfo.imageLinks.thumbnail : "https://secocms.cpa.texas.gov/sca-dev-kilimanjaro/img/no_image_available.jpeg"}
            description={items.volumeInfo.description}
            saveGoogleBook={this.props.saveGoogleBook}
            />
        ))
        )

    }
}

export default BookList
